import React from 'react'
import Stack from '@mui/material/Stack';
import { Typography } from '@mui/material';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Grid from '@mui/material/Grid';
import PortfolioBox from './PortfolioBox';
import Userlogo from '../images/userlogo.png'
import Gamelogo from '../images/onetofifty.png'
import InputModal from './InputModal';


const Rightcolumn = () => {
  return (
    <>
        <Stack direction="row" justifyContent={'space-between'}  sx={{padding:"24px 64px 0 64px"}}>
          <Typography sx={{fontSize:"22px",fontFamily:'Inter',fontWeight:"800",color:"#1A191D"}}>User List</Typography>
          <InputModal/>  
        </Stack>

        <Grid container spacing={4} padding="64px" flexGrow={1}>
          <Grid item lg={2.4} >
           <PortfolioBox img={"https://usermanagement-sjp.netlify.app/"} name={Userlogo} email={"Customer Management App"} phone={"Quick and easy customer management"}/>
          </Grid>

        </Grid>

    </>
  )
}

export default Rightcolumn
